define('text!aurelia-editables/resources/elements/pager.html', ['module'], function(module) { module.exports = "\r\n<template>\r\n    <ul class=\"pagination\" style=\"margin: 0\">\r\n        <li if.bind=\"total > 1\" class.bind=\"current === 1 ? 'disabled' : ''\">\r\n            <a href=\"#\" aria-label=\"${'Previous' | t}\" click.delegate=\"prev()\">\r\n                <span aria-hidden=\"true\">&laquo;</span>\r\n            </a>\r\n        </li>\r\n\r\n        <li if.bind=\"total > 1\" repeat.for=\"page of total\" class.bind=\"page === current-1 ? 'active' : ''\">\r\n            <a href=\"#\" click.delegate=\"setPage(page+1)\">${page+1}</a>\r\n        </li>\r\n\r\n        <li if.bind=\"total > 1\" class.bind=\"current === total ? 'disabled' : ''\">\r\n            <a href=\"#\" aria-label=\"${'Next' | t}\" click.delegate=\"next()\">\r\n                <span aria-hidden=\"true\">&raquo;</span>\r\n            </a>\r\n        </li>\r\n        <li>\r\n            <a>\r\n                <span if.bind=\"count > 0\">${(current * size) - size + 1} - ${(current * size) > count ? count : (current * size)} of</span>\r\n                ${count} records\r\n            </a>\r\n        </li>\r\n    </ul>    \r\n</template>"; });
